class Solution:
    def findLength(self, nums1, nums2):
        len_num1,len_num2 =len(nums1),len(nums2)
        dp_array = [[0] * (len_num2+1) for r in range(len_num1+1)]
        max_num = 0
        for row in range(1,len_num1+1):
            for col in range(1,len_num2+1):
                dp_array[row][col] = 1 + dp_array[row-1][col-1] if nums1[row-1] == nums2[col-1] else 0
                max_num = max(max_num,dp_array[row][col])        
        return max_num
    
